import React, { Component } from 'react'

export class NameList extends Component {
  render() {
    let persons = [
      {
        id: 1,
        name: "Adil",
        age: 17,
      },
      {
        id: 2,
        name: "Nurik",
        age: 18,
      },
      {
        id: 3,
        name: "Danil",
        age: 18,
      },
    ]
    let listName = persons.map((person) => <div>{person}</div>)
    return <div>{listName}</div>

    return (
      <div>
        {listName}
      </div>
    )
  }
}

export default NameList
